  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });

function Home() {

   return (
        <h1>Home</h1>
   ) 
}


export default Home
